&lt;p&gt;There are two of Jesus' disciples whom I would particularly like to have known in the days of their earthly life. One is Peter, and the other is John. I like these two men. I am especially impressed by the change that fellowship with the Lord Jesus produced in their lives. This is what intrigues me about these two.&lt;/p&gt;
&lt;p&gt;Peter, as you know, was erratic, impulsive, brash. As someone has well said, &quot;Whenever Peter enters a scene, it's always with a thud.&quot; He seems to have a gift for putting his foot in his mouth -- he suffered from hoof-in-mouth disease. Yet the Lord made him a steady, stable, dependable rock, as his name implies. He became a rallying point, a gathering point for the Christians in the days of the persecutions which broke out in the first century. It was only because he was with the Lord, and knew the Lord. Most of the change took place after the Lord's death and resurrection, however, so we do not need to feel that it was the personal presence of Jesus that changed these men. He changed them after he died and rose again, just as he can change us.&lt;/p&gt;
&lt;p&gt;John was the other one who was dramatically changed by our Lord. He was a young man, the youngest of all the disciples. In fact, many scholars feel that he was a teenager when he first started to follow the Lord. Perhaps he was seventeen or eighteen years of age. Along with his brother, James, he was a hot-headed young man, given to sharp and impulsive utterances with a tendency toward blowing off steam. He was probably a loudmouth, because Jesus nicknamed him Son of Thunder. That was our Lord's gentle way of labeling John's problem. He just kept the thunder rolling all the time. So our Lord called both James and John Sons of Thunder.&lt;/p&gt;
&lt;p&gt;But John became the apostle of love. He was noted for his gentleness and his graciousness and his goodness. He was called &quot;The Virgin.&quot; As far as we know, he never married. There is no record that he ever did. But he was called &quot;virgin&quot; primarily because of the purity of his life. He became a man who was characterized by such an outstanding devotion and love for the Lord Jesus, that all his life he was singled out as the apostle of love.&lt;/p&gt;

