&lt;p&gt;Reading through Paul's second letter to the church at Corinth makes you aware that this is the most personal and emotional of all his letters. It throbs with a sense of the glories of God's grace.&lt;/p&gt;
&lt;p&gt;Visiting Corinth on my recent trip was a moving experience for me. There is very little left standing of the original city -- it was destroyed by the Romans shortly after Paul's visit there and has been lying in ruins ever since. Certain temple columns remain, though. as well as the market place and other public areas of the city. They can be clearly discerned, and the actual pavement of the judgment hall of the Roman proconsul is well preserved.&lt;/p&gt;
&lt;p&gt;It wasn't hard for me to imagine the Apostle Paul as he came down from Athens into this city which was at the time a center of pleasure, a great commercial city and a city of great beauty, with many, many temples. It had gained a reputation as the center of lascivious worship -- the worship of the Goddess of Love. There were some 10,000 prostitutes attached to the temple of Aphrodite and the city lived up, or perhaps I should say, down, to its reputation as a place of sensual pleasure. It represented a sex-saturated society. You can see indications of this in Paul's letters to the church there. It was easy to imagine the apostle arriving in the dust of the road unknown and unheralded a simple tentmaker by all appearance. Finding two people of the same trade, Aquila and Priscilla, he lived and worked with them, and preached up and down the city streets and in the market places and synagogues. Thus God used him to lay the foundations of the church at Corinth.&lt;/p&gt;

