The 40-Day Bible Challenge is a simple idea: let’s actually read the Bible.  Not just a verse here or there.  Not without seeing the big picture.  Most of all, let’s not do it alone.  Instead, let’s experience the Bible as it was meant to be read, whole books in community.&#13;
&#13;
We don’t need more Bible studies with fill-in-the-blank answers to easy questions.  Let’s have a real conversation about the Bible—one that anyone can join, no matter where they are in their faith journey.&#13;
&#13;
Let’s go beyond reading the Bible in fragments.  Let’s go beyond reading in isolation.  Let’s discover the complete story—understood in context, experienced in community.

